  false,\n\t\"url\": null,\n\t\"notes\": \"Objectives of the Fall 2011 Small Pelagics
  Survey were to sample the waters of the northern Gulf of Mexico less than 500 meters
  deep with 90-ft high opening fish trawls to determine the abundace and distribution
  of demersal and pelagic fish species, collect length-frequency data and biological
  samples from collected species, collect water column profiles of temperature, salinity,
  and dissolved oxygen concentration, and collect ichtyoplankton, meiofauna, and sediment
